import React from "react";
import styled from "styled-components";

// IMPORT COMPONENT
import CartMenuButton from "./CartMenuButton";

function MenuItems() {
  return (
    <React.Fragment>
      <MenuItemsContainer>
        <nav>
          <ul>
            <li>Item 1</li>
            <li>Item 2</li>
          </ul>
          <CartMenuButton />
        </nav>
      </MenuItemsContainer>
    </React.Fragment>
  );
}

export default MenuItems;

const MenuItemsContainer = styled.div`
  width: 50%;
  nav {
    display: flex;
    justify-content: flex-end;
    ul {
      display: flex;
      justify-content: space-between;
      align-items: flex-end;
      flex-wrap: wrap;
      color: white;
      list-style: none;

      li {
        text-align: center;
        padding: 0 2rem;
      }
    }
    button {
    }
  }
`;
